import React  from 'react'

export default function PlaceDetail({place}) {
    const{name, image, country, funFacts, likes} = place
  return (
    <div className="place-div">
      <img className="place-image"src={image} alt={name} />
      <h2 className="place-name">{name}</h2>
      <p className="place-country"> {country}</p>
      <p className="place-facts"> {funFacts}</p>
      <p className="place-likes">Likes: {likes}</p>
    </div>
  );
}
